function getCookie(cname) {
  let name = cname + "=";
  //on recupere le nom du cookie
  let decodedCookie = decodeURIComponent(document.cookie);
  //on decode le cookie
  let ca = decodedCookie.split(';');
  //on separe les cookies
  for (let i = 0; i < ca.length; i++) {
      //on parcours les cookies
      let c = ca[i];
      //on recupere le cookie
      while (c.charAt(0) == ' ') {
          //on supprime les espaces
          c = c.substring(1);
          //on supprime les espaces
      }
      if (c.indexOf(name) == 0) {
          //on verifie si le cookie correspond au nom
          return c.substring(name.length, c.length);
          //on retourne la valeur du cookie
      }
  }
  return "";
  //on retourne une chaine vide
}
